const PetMedicalRecord = ({ record }) => {
    return (
        <div className="record">
            <h2 className="recordTitle">{ record.date }</h2>
            <ul className="recordulst">Culnic: { record.culnic }</ul>
            <ul className="recordulst">Address: { record.address }</ul>
            <ul className="recordulst">Phone: { record.phone }</ul>
            <ul className="recordulst">Doctor: { record. doctor }</ul>
        </div>    
    )
}

export default PetMedicalRecord
